import React, { Component } from "react";
import './about.scss'
import delighters from "../common/delighters";
import ReactFullpage from "@fullpage/react-fullpage";
import {NavLink} from "react-router-dom";

class About extends Component {
    componentDidMount() {
        delighters.init();
    }
    render() {
        const Fullpage = () => (
            <ReactFullpage
                render={() => {
                    return (
                        <ReactFullpage.Wrapper>
                        <section className="about">
                                <section className="my-name">
                                    <div className="left">
                                        <h1>Yasuhiro Katayama.<span>Front End developer.</span></h1>
                                    </div>
                                    <div className="right">
                                        <img src="/img/img-profile.png" alt=""/>
                                    </div>
                                </section>
                                <section className="about-me">
                                    <div className="left">
                                        <h2>I am…</h2>
                                    </div>
                                    <div className="right">
                                        <p>I am currently studying at Cornerstone International Community College of Canada (CICCC) for Web and Mobile Development program.
                In Japan, I worked as a frontend engineer for two years and backend engineer for one year and 6 months. I am looking for work experience in Canada so I would be happy just to work as an intern or volunteer. I love programming and would like to learn new skills.</p>
                                    </div>
                                </section>
                                <section>
                                    <div className="left">
                                        <h2>My skills</h2>
                                    </div>
                                    <div className="right">

                                    </div>
                                </section>
                                <section>
                                    <div className="left">
                                        <h2>Yasuhiro Katayama.<span>Front End developer.</span></h2>
                                    </div>
                                    <div className="right">
                                        <img src="/img/img-profile.png" alt=""/>
                                    </div>
                                </section>
                            </section>
                        </ReactFullpage.Wrapper>
                    );
                }}
            />
        );
        return (
            Fullpage()
        );
    }
}

export default About;
